import { useState } from "react";
import { useLocation } from "react-router-dom";
import clsx from "clsx";
import { Moon, Sun, Menu, User } from 'lucide-react';
import Logo2 from "../../../assets/Logo2.png";

const Headers = ({ darkMode, toggleDarkMode, toggleSidebar }) => {
    const location = useLocation();
    const excludedPaths = ["/", "/login"];
    const isExcludedPath = excludedPaths.includes(location.pathname);
    
    // State untuk mengontrol visibilitas modal
    const [isModalOpen, setIsModalOpen] = useState(false);

    // Fungsi untuk membuka dan menutup modal
    const openModal = () => setIsModalOpen(true);
    const closeModal = () => setIsModalOpen(false);

    return (
        <>
            <nav className={clsx("fixed top-0 z-50 w-full bg-white",
                "border-b border-gray-200 dark:bg-gray-800 dark:border-gray-700")}>
                <div className="px-2 py-3 lg:px-5 lg:pl-3">
                    <div className="flex items-center justify-between">
                        <div className="flex items-center justify-start rtl:justify-end">
                            {!isExcludedPath && (
                                <button className={clsx("inline-flex items-center p-2 text-sm text-gray-500 rounded-lg",
                                    "hover:bg-gray-100 focus:ring-gray-200",
                                    "dark:text-gray-400 dark:hover:bg-gray-700 dark:focus:ring-gray-600"
                                )}
                                    onClick={toggleSidebar}
                                >
                                    <Menu className="text-2xl" />
                                </button>
                            )}
                            <a href="/#" className="flex items-center space-x-2">
                                <img src={Logo2} alt="Logo" width="60" height="50" />
                                <span className="self-center text-xl font-semibold sm:text-2xl whitespace-nowrap dark:text-white">SIOPS</span>
                            </a>
                        </div>
                        <div className="flex items-center space-x-4">
                            {/* Tombol untuk membuka modal login */}
                            {isExcludedPath && (
                                <button 
                                    className="flex items-center justify-center space-x-2 dark:bg-white w-10 h-10 rounded-full shadow-md"
                                    onClick={openModal}
                                >
                                    <User size={24} className="dark:text-black" />
                                </button>
                            )}
                            <button className="dark:bg-slate-50 dark:text-slate-700 rounded-full p-2 font-bold"
                                onClick={toggleDarkMode}>
                                {darkMode ? <Sun /> : <Moon />}
                            </button>
                        </div>
                    </div>
                </div>
            </nav>

            {/* Modal Login */}
            {isModalOpen && (
                <div className="fixed inset-0 z-50 flex items-center justify-center bg-black bg-opacity-50">
                    <div className="bg-white p-6 rounded-lg shadow-lg max-w-sm w-full">
                        <h2 className="text-xl font-bold mb-4">Login</h2>
                        <form>
                            <div className="mb-4">
                                <label className="block text-gray-700">Email</label>
                                <input 
                                    type="email" 
                                    className="w-full p-2 border border-gray-300 rounded-lg" 
                                    placeholder="Enter your email" 
                                />
                            </div>
                            <div className="mb-4">
                                <label className="block text-gray-700">Password</label>
                                <input 
                                    type="password" 
                                    className="w-full p-2 border border-gray-300 rounded-lg" 
                                    placeholder="Enter your password" 
                                />
                            </div>
                            <button 
                                type="submit" 
                                className="w-full bg-blue-500 text-white py-2 rounded-lg hover:bg-blue-600"
                            >
                                Login
                            </button>
                        </form>
                        <button 
                            className="mt-4 text-gray-500 hover:text-gray-700"
                            onClick={closeModal}
                        >
                            Close
                        </button>
                    </div>
                </div>
            )}
        </>
    );
};

export default Headers;
